// import "../../css/workList/workList.css";
// import { WorkList } from "./WorkList";
// import { faCog } from "@fortawesome/free-solid-svg-icons";
// import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

import { useTodoSort } from "../../hooks/todolist/useTodoSort";
import { TodoList } from "./TodoList";

export const INIT_SORT_TYPE_IDX = 1,
  SORT_TYPE_CNT = 2,
  SORT_TYPES = 2;
export const TodoListTemplate = ({ user, date }) => {
  const todoSortHook = useTodoSort(
    INIT_SORT_TYPE_IDX,
    SORT_TYPE_CNT,
    SORT_TYPES
  );
  return (
    <div className="todo-list__template">
      <header className="todo-list__header">
        <h1>Make TodoList</h1>
      </header>
      <TodoList user={user} date={date} todoSortHook={todoSortHook} />
    </div>
  );
};
